	// so 0.05 as a distance represents a radius of 1/20th of the screen size
	if (dist(relativeMousePos, relativePixelPos) < 0.05) {
		fragColor = vec4(0);
	}
	else {
		fragColor = vec4(relativePixelPos.xy, 0.0, 1.0);
	}
